import { Icon } from "@/components/ui/primitives/Icon/Icon";

// Figma component props
interface FigmaAvatarProps extends BaseFigmaProps {
  Type?: "Initial" | "Image";
  Size?: string;
  Shape?: "Circle" | "Square";
}

